-- Copiando estrutura para função aion.fncCodigo
DELIMITER //
CREATE FUNCTION `fncCodigo`(`id` INT,
	`prefix` CHAR(5)
) RETURNS text CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
    DETERMINISTIC
BEGIN
	RETURN (CONCAT(prefix,LPAD(id, 5, '0')));
END//
DELIMITER ;

-- Copiando estrutura para função aion.fncCodigoNovo
DELIMITER //
CREATE FUNCTION `fncCodigoNovo`(`GRUPO` INT
) RETURNS char(10) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
    DETERMINISTIC
BEGIN
	RETURN (SELECT CONCAT(b.sufixo_identificacao, LPAD(MAX(SUBSTRING(codigo_produto, -5, 5) * 1) + 1, 5, '0')) codigo_novo FROM aion_produto AS a 
	INNER JOIN aion_produto_grupo AS b ON a.id_grupo=b.id 
	WHERE a.id_grupo=GRUPO);
END//
DELIMITER ;

-- Copiando estrutura para função aion.fncOrdemServicoOK
DELIMITER //
CREATE FUNCTION `fncOrdemServicoOK`(`CODIGO` INT
) RETURNS int(11)
    DETERMINISTIC
BEGIN
	RETURN (SELECT j.id FROM aion_ordem_servico_historico AS j 
		INNER JOIN aion_observacao AS h ON h.id=j.id_observacao AND h.parada=0 
		WHERE j.id = (SELECT MAX(h.id) FROM aion_ordem_servico_historico AS h WHERE h.id_ordem_servico=fncCodigo(CODIGO, 'OS-0') LIMIT 1));
END//
DELIMITER ;

-- Copiando estrutura para função aion.fncQuantidadeProntaOS
DELIMITER //
CREATE FUNCTION `fncQuantidadeProntaOS`(`CODIGO` INT
) RETURNS int(11)
    DETERMINISTIC
BEGIN
	RETURN (SELECT SUM(a.quantidade) FROM aion_ordem_servico_historico AS a WHERE a.id_ordem_servico=fncCodigo(CODIGO, 'OS-0'));
END//
DELIMITER ;

