-- Removendo tabela temporária e criando a estrutura VIEW final
DROP TABLE IF EXISTS `vw_tempo_os`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_tempo_os` AS with NextObservation as (select `t1`.`id` AS `id`,`t1`.`id_ordem_servico` AS `id_ordem_servico`,`t1`.`id_equipamento` AS `id_equipamento`,`t1`.`id_observacao` AS `id_observacao`,`t1`.`id_usuario` AS `id_usuario`,`t1`.`teve_almoco` AS `teve_almoco`,`t1`.`quantidade` AS `quantidade_observacao_1`,`t1`.`data` AS `data_observacao_1`,`t2`.`quantidade` AS `quantidade_proxima`,`t2`.`data` AS `data_proxima`,`t2`.`teve_almoco` AS `teve_almoco_1` from (`aion_ordem_servico_historico` `t1` join `aion_ordem_servico_historico` `t2` on(`t1`.`id_ordem_servico` = `t2`.`id_ordem_servico` and `t1`.`id_equipamento` = `t2`.`id_equipamento` and `t1`.`data` < `t2`.`data` and `t1`.`id_observacao` = 1 and `t2`.`id_observacao` <> 1)) where `t2`.`data` = (select min(`t2_inner`.`data`) from `aion_ordem_servico_historico` `t2_inner` where `t2_inner`.`id_ordem_servico` = `t1`.`id_ordem_servico` and `t2_inner`.`id_equipamento` = `t1`.`id_equipamento` and `t2_inner`.`data` > `t1`.`data` and `t2_inner`.`id_observacao` <> 1))select `NextObservation`.`id_ordem_servico` AS `id_ordem_servico`,sum(timestampdiff(SECOND,`NextObservation`.`data_observacao_1`,`NextObservation`.`data_proxima`) - if(`NextObservation`.`teve_almoco` = 1,3600,0) - if(`NextObservation`.`teve_almoco_1` = 1,3600,0)) AS `diff_segundos` from `NextObservation` group by `NextObservation`.`id_ordem_servico` order by `NextObservation`.`id_ordem_servico` 
;

